import "./Contact.scss";
import Button from "../Button/Button";
import Wave from "../Wave/Wave";

export default function Contact() {
  const handleSubmit = (e) => {
    e.preventDefault();
    let formData = new FormData(e.currentTarget);
    for (var [key, value] of formData.entries()) {
      console.log(key, value);
    }
  };

  return (
    <div className="contact">
      <h2 className="contact__title">&#128232; - Get In Touch</h2>

      <Wave />
      <form className="form" onSubmit={handleSubmit}>
        <label htmlFor="name">Name</label>
        <input type="text" id="name" className="form__name" />

        <label htmlFor="email">Email</label>
        <input type="text" id="email" className="form__email" />

        <label htmlFor="message">Message</label>
        <input type="text" id="message" className="form__message" />

        <Button className="form__button" type>
          Send
        </Button>
      </form>
      <Wave flipped="true" />
    </div>
  );
}
